        self.__node = [0] * (self.__n + 1)

        self.__data = [0] * (self.__n + 1)



        S = [0] * (self.__n + 1)

        for i in range(1, self.__n + 1):

            S[i] = S[i - 1] + A[i - 1]

            self.__data[i] = A[i - 1]

            self.__node[i] = S[i] - S[i - (i & -i)]



    def add(self, i, v):

        self.__data[i] += v

        while i <= self.__n:

            self.__node[i] += v

            i += i & -i



    def sum(self, i):

        ''' [1, i]の和

